import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Routing from './App';
import DataProvider from './redux/store'
ReactDOM.render(
    <DataProvider>
    <Routing/>
    </DataProvider>,
  document.getElementById('root')
);

